	if (i < n) {
		d = s[i] - 48;
		if (d >= 0 && d <= 9) {
			i++;
			r = 10 * r + d;
		}
		if (i < n && s[i] == 58) {
			i++;
			if (i >= n)
				return -1;
			d = s[i] - 48;
			if (d < 0 || d > 5)
				return -1;
			i++;
			r = (6 * r + d) * 10;
			if (i >= n)
				return -1;
			d = s[i] - 48;
			if (d < 0 || d > 9)
				return -1;
			i++;
			r += d;
		}
	}
	r *= 1000;
	if (i >= n)
		return r;
	if (s[i] != 46)
		return -1;
	i++;
	if (i >= n)
		return -1;
	d = s[i] - 48;
	if (d < 0 || d > 9)
		return -1;
	i++;
	r += 100 * d;
	if (i >= n)
		return r;
	d = s[i] - 48;
